import React from 'react';
import Card from 'cntd';

const UserProfile = () => {
  return (
    <Card
      actions={[
        <div key="짹짹"></div>,
        <div key="팔로잉"></div>,
        <div key="팔로워"></div>
      ]}
    >
      <Card.Meta
        avatar={<Avatar src="https://zos.alipayobjects.com/rmsportal/ODTLcjxAfvqbxHnVXCYX.png" />}
        title="Card title"
        description="This is the description"
      >

      </Card.Meta>
    </Card>
  );
}

export default UserProfile;
